import React from "react";
import logo from "./images/instagram_logo.png";

const Sidenav=()=>{
   return(
     <>
       <div className="navbar">
        <img src={logo} alt="instagram-logo"/>
        <img src="https://www.pngkey.com/png/detail/28-287308_instagram-logo-text-white.png" alt="Instagram Logo Text White@pngkey.com"></img>
       </div>
    </>
   );
}

export default Sidenav;
